      img: img
    },
  ];
  return (
    <Section
      title={"about"}
      description={"Lorem ipsum dolor sit amet consectetur."}
    >
      <div id="stories">
        {stories.map((story, index) => (
          <Story key={index} story={story} order={index} />
        ))}
      </div>
    </Section>
  );
};
